        SELECT DISTINCT ?militaryForce ?commander ?event ?societalEvent
        WHERE {
            ?battle dbo:militaryUnit ?militaryForce ;
                   dbo:commander ?commander ;
                   rdf:type dbo:Battle .
            ?campaign dbo:isPartOf ?battle ;
                     dbo:militaryUnit ?militaryForce ;
                     rdfs:label "French campaign in Egypt and Syria" .
            ?event dbo:isPartOf ?battle ;
                  rdfs:label "Battle of Fort Royal" .
            ?societalEvent dbo:isRelatedTo ?event ;
                         rdfs:label "Robert Calder" .
        }
    }
}

