SELECT DISTINCT ?commander
WHERE {
  ?regiment dbo:militaryUnitSize "30th (Cambridgeshire) Regiment of Foot" .
  ?regiment a dbo:MilitaryUnit .
  ?battle1 dbo:militaryForce ?regiment ;
           rdf:type dbo:MilitaryConflict, dbo:Event .
  ?battle2 dbo:militaryForce ?regiment ;
           rdf:type dbo:Battle ;
           rdfs:label "Battle of Fort Royal" .
  ?force dbo:militaryForce ?regiment ;
         rdf:type dbo:Event, dbo:SocietalEvent ;
         dbp:commander ?commander .
  ?commander rdfs:label "Robert Calder" .
}

