PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT DISTINCT ?commander ?author ?book ?spouse
WHERE {
  ?event dbo:conflict dbr:Third_Taiwan_Strait_Crisis .
  ?event dbo:commander ?commander .

  ?work dbo:author ?author ;
          a dbo:WrittenWork ;
          a dbo:Book .

  ?bill_clinton dbo:spouse ?hillary_clinton ;
              a dbo:Politician ;
              a dbo:OfficeHolder .

  ?book dbo:author ?hillary_clinton ;
         a dbo:Book ;
         a dbo:WrittenWork .

  FILTER (?author = dbr:Bill_Clinton)
  FILTER (?hillary_clinton = dbr:Hillary_Clinton)
}

