PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?commander ?militaryForce
WHERE {
    { 
        ?event dbo:commander ?commander ;
              rdf:type dbo:MilitaryConflict, dbo:Event ;
              dbp:militaryUnit ?militaryForce .
        FILTER (?commander = "Napoleon" )
        FILTER REGEX(?event, "French campaign in Egypt and Syria")
    } UNION {
        ?person dbo:militaryBranch ?militaryForce ;
               rdf:type dbo:Person ;
               rdfs:label "William Bayne (Royal Navy officer)"@en .
    } UNION {
        ?battle dbo:militaryUnit ?militaryForce ;
              rdf:type dbo:Event, dbo:MilitaryConflict ;
              rdfs:label "Battle of Cape Finisterre (1805)"@en .
    }
}

