}

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?father
WHERE {
    ?child dbo:title "Royalty" .
    ?reference dbo:title "Royalty" ;
              dbo:officeHolder dbp:monarch .
    ?williamI rdf:type dbo:Monarch ;
               rdfs:label "William I" .
    ?rogerIII rdf:type dbo:Noble ;
               rdfs:label "Roger III, Duke of Apulia" .
    ?parent rdf:type dbo:Parent ;
             dbo:child ?rogerIII .
    ?child dbo:parent ?parent ;
             dbo:reference ?reference .
    ?father dbo:child ?child .
}
